import React, { useState } from 'react';
import { useAuth } from '../hooks/useAuth';
import { loginWithKakao } from '../apis/auth';

const Login: React.FC = () => {
  const { setUser } = useAuth();
  const [token, setToken] = useState('');

  const handleKakaoLogin  = async () => {
    // 카카오 로그인 API 호출 예제
    const token = await getKakaoToken(); // 토큰을 가져오는 함수 필요
    const user = await loginWithKakao(token);
    setUser(user);
    console.log("카카오 로그인 버튼 클릭됨");
  };

  const getKakaoToken = async () => {
    // 여기에 카카오 로그인 로직 추가 (SDK 사용)
    // 이 부분은 카카오 SDK 문서를 참고하세요.
    // 예시로 토큰을 반환합니다.
    return "your_kakao_access_token"; 
  };


  return (
    <div style={{ width: 1440, height: 664, position: 'relative', background: '#FAE3D4' }}>
      <div style={{ width: 671, height: 1440, left: 0, top: 669, position: 'absolute', transform: 'rotate(-90deg)', transformOrigin: '0 0', background: '#FDF7FF' }}>
        <div style={{ width: 671, height: 1440, left: 0, top: 0, position: 'absolute', background: '#FDF7FF', borderRadius: 9.28 }}>
          <div style={{ width: 671, height: 1440, left: 0, top: 1440, position: 'absolute', borderRadius: 9.28, overflow: 'hidden' }}>
            <div style={{ width: 671, height: 1440, left: 0, top: 0, position: 'absolute', background: 'linear-gradient(169deg, rgba(255, 255, 255, 0) 26%, white 100%)' }} />
            <div style={{ width: 671, height: 1440, left: 0, top: 0, position: 'absolute', background: '#E9DDFF' }} />
            <div style={{ width: 671, height: 1440, left: 0, top: 0, position: 'absolute', background: 'linear-gradient(169deg, white 0%, rgba(255, 255, 255, 0) 72%)' }} />
            <div style={{ width: 671, height: 1440, left: 0, top: 0, position: 'absolute', background: '#FFD9E3', borderRadius: 9.28 }} />
          </div>
        </div>
      </div>
      <div style={{ left: 453, top: 571, position: 'absolute', color: 'black', fontSize: 32, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word' }}>
        져니버디와 함께하세요!
      </div>
      <div style={{ left: 349, top: 518, position: 'absolute', color: 'black', fontSize: 32, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word' }}>
        친구와 함께하는 스마트한 여행,
      </div>

      {/* 카카오 로그인 버튼 */}
      <div style={{ width: 380, height: 72, left: 900, top: 260, position: 'absolute', background: '#FEE500', borderRadius: 25, display: 'flex', justifyContent: 'center', alignItems: 'center', cursor: 'pointer' }} onClick={handleKakaoLogin}>
        <div style={{ color: '#3E0E0E', fontSize: 28, fontFamily: 'Inter', fontWeight: '500' }}>
          카카오 로그인하기
        </div>
      </div>

      <img style={{ width: 470, height: 370, left: 73, top: 201, position: 'absolute' }} src="https://via.placeholder.com/470x370" alt="Placeholder" />
      <div style={{ left: 983, top: 421, position: 'absolute', display: 'inline-flex', alignItems: 'flex-start' }}>
        <div style={{ textAlign: 'center', color: 'rgba(0, 0, 0, 0.70)', fontSize: 14, fontFamily: 'Pretendard Variable', fontWeight: '400', lineHeight: 19.60, wordWrap: 'break-word' }}>
          신규 사용자이신가요?
        </div>
        <div style={{ textAlign: 'center', color: 'black', fontSize: 14, fontFamily: 'Pretendard Variable', fontWeight: '500', lineHeight: 19.60, wordWrap: 'break-word' }}>
          회원가입
        </div>
      </div>
    </div>
  );
};

export default Login;
export {};
